postcontent:
The BLACKHAWK! Ranger Assault Pack Tactical Operations Ruck (R.A.P.T.O.R.) is free-fall and static-line jumpable with a built-in harness and attachment system. 
It is constructed of heavy-duty 1000 denier nylon and quad-stitched seams and triple-taped edges. 
Features: Includes 100 oz. BLACKHAWK! Hydration System; 
made to U.S. Special Ops specifications; 
ventilating back panel; 
built-in jump harness with heavy-duty parachute webbing; 
built-in drop-line pouch and routing system; 
fully accessible main compartment; 
silent zipper pulls; 
and BTS webbing on outside of pack for modular gear attachment. 

Main Compartment: 20”L x 13.75”W x 6.75”D Side comp: 20”L x 12”W x 3.5”D Cube: 2850 cu. in. / 4 L

WILL SHIP
